import {SET_LIST_DATA} from '../Redux/Action.js'
const initializeState={
    iteam:[]
}

const ToDoReducer=(state=initializeState,action)=>{

    switch(action.type){
        case SET_LIST_DATA: return{
            ...state,
            iteam:action.value
        }

        default: return state;
    }
}
export default ToDoReducer
